import React from "react";

const Header = () => {
  return (
    <div>
      <div className="bg-white shadow p-5">
        <ul className="flex flex-wrap items-center justify-center gap-5">
          <li>Home</li>
          <li>Courses</li>
          <li>Pages</li>
          <li>Gallery</li>
          <li>Contact us</li>
        </ul>
        <div className="flex justify-end gap-5">
        <ol>
          <li>Login</li>
        </ol>
        <button>Login</button>
      </div>
      </div>
     
    </div>
  );
};

export default Header;
